import renderIndexMenu from './indexMenu';
import ProfileListItem from "./profileListItem"
import * as style from "../../css/light/profileList";
import totalToRender from "../profileTotal/totalToRender"

//Extends SearchList
export default function ProfileListContainer(props) {
  function renderList(value) {
    return totalToRender(value, props.totalToRenderNumber).map((item, i) => (
      <ProfileListItem 
        key={`ListItem${i}`} 
        data={item}
        focused={props.focused} 
        setFocused={props.setFocused}/>
    ))
  }

  function renderListContainer(listName, i) {
    if (i === 1) {
      return (
        <div>
          {renderIndexMenu(props.profileDataToRender[listName.toLowerCase()])}
          {renderList(props.profileDataToRender[listName.toLowerCase()])}
        </div>
      )
    }
    else {
      return (
        <div>
            <div style={{height: "10px"}}></div>
            {renderIndexMenu(props.profileDataToRender[listName.toLowerCase()])}
            {renderList(props.profileDataToRender[listName.toLowerCase()])}
        </div>
      )
    }
  }

  return (
    <div style={style.listContainer}>
      {(() => {
        return props.listToRender.map((listName, i) => (
          <div key={`ListContainer${i}`}>
            {renderListContainer(listName, i)}
          </div>
        ))
      })()}
    </div>
  )
}
